import React, { useState } from 'react'
import { useSelector } from 'react-redux'

function Profile() {

  const { user } = useSelector(state => state.auth);
  const [userInfos, setuserInfos] = useState({})

  useEffect(() => {

    setuserInfos(user)

    return () => {
      setuserInfos({})
    }
  }, [user])


  if (user) {
    return (
      <div>
        {user.Email}
      </div>
    )
  } else {
    return (
      <></>
    )
  }
}

export default Profile
